import React, { useState,createContext, useEffect } from 'react'
import DropDown from '../Assests/images/DropDown.svg';
import Inputarea from './Inputarea'
import Plus from '../Assests/images/Plus.svg'
import userContext from './UserContext';
import Minus from '../Assests/images/minus.png';
import WeeklyUpdate from './WeeklyForm/WeeklyUpdate';





const CommonDropDown = (props) => {

const { onChange } = props;

  const [designer, setDesigner] = useState(0);
  const [frontEnd, setFrontEnd] = useState(0);
  const [backEnd, setBackEnd] = useState(0);
  const [qa, setQA] = useState(0);

  const [total, setTotal] = useState(0);
  const [perform, setPerform] = useState(false);

  const final={
    Total:total,
    Designer:designer,
    FrontEnd:frontEnd,
    BackEnd:backEnd,
    QA:qa
  }

  const onClickDropdown = (e) => {
   debugger
    const { id } = e.target;
    if(id === 'designer'){

      setDesigner(designer + 1);
      console.log("designer",designer);
      setTotal(total + 1) 
    }
    if(id === 'frontEnd'){
      setFrontEnd(frontEnd + 1);
      console.log("frontend",frontEnd);
      setTotal(total + 1) 
    }
    if(id === 'backEnd'){
      setBackEnd(backEnd + 1);
      console.log("backend",backEnd);
      setTotal(total + 1) 
    }
    if(id === 'qa'){
      setQA(qa + 1);
      console.log("qa",);
      setTotal(total + 1) 
    }
    console.log({total:total,designer:designer,frontEnd:frontEnd,backEnd:backEnd,qa:qa});
    onChange({total:total,designer:designer,frontEnd:frontEnd,backEnd:backEnd,qa:qa})
   }

  return (
    <div>

      {/* {console.log(value)} */}

      <div className='SelectField'>

        <span className='SelectField_Placeholder'>{total}</span>


        <img className='SelectField_Arrow'
          src={DropDown}

          onClick={() => setPerform(!perform)}
        />

</div>












     {(perform)?(
      <div>

        <div className='option'>


          <div className='option_title'>
            <span className='option_title_Design'>Designer</span>

            <div className='option_title_performance'>
             <img className='option_title_performance_Plus' id='designer' onClick={(e)=>onClickDropdown(e)} src={Plus} />
              <span className='option_title_performance_count'>{designer} </span>
              <img className='option_title_performance_Minus' onClick={() => { setDesigner(designer - 1); setTotal(total - 1) }} src={Minus} />
            </div>

          </div>



          <div className='option_title'>
            <span className='option_title_FrontEnd'>Front End Developer</span>

            <div className='option_title_performance'>
              <img className='option_title_performance_Plus' id='frontEnd' onClick={(e)=>onClickDropdown(e)} src={Plus} />
              <span className='option_title_performance_count'>{frontEnd}</span>
              <img className='option_title_performance_Minus' onClick={() => { setFrontEnd(frontEnd - 1); setTotal(total - 1) }} src={Minus} />
            </div>
          </div>

          <div className='option_title'>
            <span className='option_title_BackEnd'>Back End Developer</span>

            <div className='option_title_performance'>

              <img className='option_title_performance_Plus' id='backEnd' onClick={(e)=>onClickDropdown(e)} src={Plus}  />
              <span className='option_title_performance_count'>{backEnd}</span>
              <img className='option_title_performance_Minus' onClick={() => { setBackEnd(backEnd - 1); setTotal(total - 1) }} src={Minus} />
            </div>
          </div>

          <div className='option_title'>
            <span className='option_title_QA'>QA</span>

            <div className='option_title_performance'>
              <img className='option_title_performance_Plus' id='qa' onClick={(e)=>onClickDropdown(e)} src={Plus}  />
              <span className='option_title_performance_count'>{qa}</span>
              <img className='option_title_performance_Minus' onClick={() => { setQA(qa - 1); setTotal(total - 1) }} src={Minus} />
            </div>

          </div>

        </div>

         </div>):""
}
      </div>


      )
}

export default CommonDropDown
